    verb, uri, id, attempt, postData) {
  var self = this;
  this.info(function() {
    return 'XMLHTTP REQ (' + id + ') [attempt ' + attempt + ']: ' + verb +
        '\n' + uri + '\n' + self.maybeRedactPostData_(postData);
  });
